import React from 'react';
// import logo from './logo.svg';
import './App.css';
import doggo from './img/doggo.jpg'


function App() {
  return (
    <div className="App">

      <header className="App-header">

        <h2 className='title'> Automatic Background Generator </h2>



        <div className = 'buttonflex'>
          <text class='hsv'> Hue:  </text>
          <button className='button' id='left'> Cool </button>
          <button className='button'> Cool & Warm </button>
          <button className='button' id='right' > Warm </button>
        </div>
         <div className = 'buttonflex'>
          <text class='hsv'> Saturation:  </text>
          <button className='button' id='left'> High </button>
          <button className='button'> High & Low </button>
          <button className='button' id='right'> Low </button>
        </div>
         <div className = 'buttonflex'>
          <text class='hsv'> Value:  </text>
          <button className='button' id='left'> Bright </button>
          <button className='button'> Bright & Dark</button>
          <button className='button' id='right' > Dark </button>
        </div>



      </header>
    </div>
  );
}

export default App;
